import React, { useState } from 'react';
import axios from 'axios';

const RegistroPersona = () => {
    const [persona, setPersona] = useState({
        pnombre: '',
        papellido: '',
        sapellido: '',
        snombre: '',
        email: '',
        fechanacimiento: '',
        identificacion: '',
        ubicacion: '',
        usuario: {
            login: '',
            password: ''
        }
    });

    const [modalMessage, setModalMessage] = useState('');
    const [modalType, setModalType] = useState('success'); // 'success' or 'error'
    const [showModal, setShowModal] = useState(false);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setPersona({
            ...persona,
            [name]: value
        });
    };

    const handleUsuarioChange = (e) => {
        const { name, value } = e.target;
        setPersona({
            ...persona,
            usuario: {
                ...persona.usuario,
                [name]: value
            }
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:9001/persona', persona);
            setModalMessage(response.data.message);
            setModalType('success');
        } catch (error) {
            const errorMessage = error.response?.data?.message || "Error al registrar la persona.";
            setModalMessage(errorMessage);
            setModalType('error');
        } finally {
            setShowModal(true);
        }
    };

    const handleCloseModal = () => {
        setShowModal(false);
    };

    return (
        <div className="container">
            <h2>Registro de Persona</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Nombre:</label>
                    <input type="text" className="form-control" name="pnombre" value={persona.pnombre} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Apellido Paterno:</label>
                    <input type="text" className="form-control" name="papellido" value={persona.papellido} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Apellido Materno:</label>
                    <input type="text" className="form-control" name="sapellido" value={persona.sapellido} onChange={handleChange} />
                </div>
                <div className="form-group">
                    <label>Segundo Nombre:</label>
                    <input type="text" className="form-control" name="snombre" value={persona.snombre} onChange={handleChange} />
                </div>
                <div className="form-group">
                    <label>Email:</label>
                    <input type="email" className="form-control" name="email" value={persona.email} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Fecha de Nacimiento:</label>
                    <input type="date" className="form-control" name="fechanacimiento" value={persona.fechanacimiento} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Identificación:</label>
                    <input type="text" className="form-control" name="identificacion" value={persona.identificacion} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Ubicación:</label>
                    <input type="text" className="form-control" name="ubicacion" value={persona.ubicacion} onChange={handleChange} />
                </div>
                <h4>Usuario</h4>
                <div className="form-group">
                    <label>Nombre de Usuario:</label>
                    <input type="text" className="form-control" name="login" value={persona.usuario.login} onChange={handleUsuarioChange} required />
                </div>
                <div className="form-group">
                    <label>Contraseña:</label>
                    <input type="password" className="form-control" name="password" value={persona.usuario.password} onChange={handleUsuarioChange} required />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>

            {/* Modal para mostrar mensajes */}
            {showModal && (
                <div className={`modal fade show`} style={{ display: 'block' }}>
                    <div className="modal-dialog">
                        <div className={`modal-content ${modalType === 'error' ? 'bg-danger text-white' : 'bg-success text-white'}`}>
                            <div className="modal-header">
                                <h5 className="modal-title">{modalType === 'success' ? 'Éxito' : 'Error'}</h5>
                                <button type="button" className="close" onClick={handleCloseModal}>
                                    <span>&times;</span>
                                </button>
                            </div>
                            <div className="modal-body">
                                <p>{modalMessage}</p>
                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                                    Cerrar
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
};

export default RegistroPersona;
